import * as THREE from '/build/three.module.js';
import { ciel_soleil2,sol } from './index_image.js';
import {GLTFLoader} from '/3D/GLTFLoader.js';
var  camera;
function main_3D() {
  const canvas = document.querySelector('#canvas_tux');
  const renderer = new THREE.WebGLRenderer({canvas});

  const fov = 75;
  const aspect = 2;  // the canvas default
  const near = 0.1;
  const far = 50000;
  camera = new THREE.PerspectiveCamera(fov, aspect, near, far);
  camera.position.y = 4;
  camera.position.z = 9;
  const point = new THREE.Vector3( 0,4, 0 );
  camera.lookAt( point );
  
  //Window
  window.addEventListener( 'mousemove', onMouseMove );
 
  
  
//SCENE
  const scene = new THREE.Scene();
  {
	  const color = 0xf7ebd0;
	  scene.fog = new THREE.FogExp2(0xf7ebd0, 0.003);
	  scene.background = new THREE.Color(color);  // red
  }
//lUmiere 
  {
    const color = 0xFFFFFF;
    const intensity = 1;
    const light = new THREE.DirectionalLight(color, intensity);
    light.position.set(-1, 2, 4);
    scene.add(light);
  }
  //SOL
   
   {		
	var loader = new THREE.TextureLoader();

	// load a resource
	var texture_fonds=loader.load( sol);
	texture_fonds.wrapS = THREE.MirroredRepeatWrapping;
	texture_fonds.wrapT = THREE.MirroredRepeatWrapping;
	texture_fonds.repeat.set( 15,15);
	var fonds_Material = new THREE.MeshBasicMaterial({
						map : texture_fonds,
						transparent : true,
						 overdraw: true,
						 color:0x4488aa
					});
	var fonds_Geometry = new THREE.PlaneGeometry(20000, 3000,1,1);
	fonds_Geometry.rotateX( -Math.PI/2 );
	var fonds_Screen = new THREE.Mesh( fonds_Geometry, fonds_Material );
	fonds_Screen.position.set(0, 0,0);
	
	scene.add(fonds_Screen);
   }
   
   
  {
	
    //OBJETS
	
	const objLoader = new GLTFLoader();
	var Pingouin={Corps:null,Tete:null,Pied_G:null,Pied_D:null,Oeil_G:null,Oeil_D:null,Bouche:null,BrasG:null,BrasD:null};
	var CQ,TX_RX,TX_RX2;
	var Antenne={base:null,parabole:null};
	var Antenne_Y={base:null,rateau:null,rot_Y:null};
	
   
	objLoader.load('/3D/TUX_CQ.glb', (tux) => {
		
		Pingouin.Corps = tux.scene.getObjectByName( "Tux_Corps");
		Pingouin.Tete = tux.scene.getObjectByName( "Tete");
		Pingouin.Pied_G = tux.scene.getObjectByName( "Pied_G");
		Pingouin.Pied_D = tux.scene.getObjectByName( "Pied_D");
		Pingouin.Oeil_G = tux.scene.getObjectByName( "OeilG");
		Pingouin.Oeil_D = tux.scene.getObjectByName( "OeilD");
		Pingouin.Bouche = tux.scene.getObjectByName( "Bouche");
		Pingouin.BrasG = tux.scene.getObjectByName( "BrasG");
		Pingouin.BrasD = tux.scene.getObjectByName( "BrasD");
		Antenne.base= tux.scene.getObjectByName( "Antenne");
		Antenne.parabole= tux.scene.getObjectByName( "Parabole");
		Antenne_Y.base= tux.scene.getObjectByName( "Antenne_Y");
		Antenne_Y.rot_Y= tux.scene.getObjectByName( "Rot_Y");
		CQ = tux.scene.getObjectByName( "CQ");
		TX_RX = tux.scene.getObjectByName( "TX_RX");
		TX_RX2 = tux.scene.getObjectByName( "TX_RX2");
		
		Antenne.base.rotation.y=-1;
		Antenne.base.position.set(10,0,-3);
		
		
		
		TX_RX.rotation.y = -1;
		TX_RX.position.set(11,0.3,-1);
		
		TX_RX2.position.set(-9,0.3,-5);
		
	  scene.add(tux.scene);
	  console.log(Pingouin.Corps);
    });
	
	
	 
  }
  //CIEL
  { 
    const ciel_soleil="data:image/jpeg;base64,";
	const loader = new THREE.TextureLoader();
	var texture_ciel = loader.load( ciel_soleil2 );
	texture_ciel.wrapS = THREE.MirroredRepeatWrapping;
	texture_ciel.wrapT = THREE.MirroredRepeatWrapping;
	texture_ciel.repeat.set( 20,20);
	var ciel_Material = new THREE.MeshBasicMaterial( { map: texture_ciel,color:0xffffff, overdraw: true, transparent: true } );
	var ciel_Geometry = new THREE.PlaneGeometry(10000, 10000,1,1);
	ciel_Geometry.rotateX( Math.PI/2 );
	var ciel_Screen = new THREE.Mesh( ciel_Geometry, ciel_Material );
	ciel_Material.opacity = 1;
	ciel_Screen.position.set(0,70,-2000);
	scene.add(ciel_Screen);	
  }

 

	 function resizeRendererToDisplaySize(renderer) {
		  const canvas = renderer.domElement;
		  const pixelRatio = window.devicePixelRatio;
		  const width  = canvas.clientWidth  * pixelRatio | 0;
		  const height = canvas.clientHeight * pixelRatio | 0;
		  const needResize = canvas.width !== width || canvas.height !== height;
		  if (needResize) {
			renderer.setSize(width, height, false);
		  }
		  return needResize;
    }
  function render(time) {
    time *= 0.001;  // convert time to seconds
	
	if (resizeRendererToDisplaySize(renderer)) {
		const canvas = renderer.domElement;
		camera.aspect = canvas.clientWidth / canvas.clientHeight;
		camera.updateProjectionMatrix();
	}
    if (Pingouin.Corps) {
			Pingouin.Corps.rotation.z =0.3*Math.sin(time);
			Pingouin.Tete.rotation.z = 0.3*Math.sin(time);
			Pingouin.Pied_G.rotation.z =- 0.3*Math.sin(time);
			Pingouin.Pied_D.rotation.z = -0.3*Math.sin(time);
			Pingouin.Oeil_G.rotation.x =- 0.005*Math.sin(time*3);
			Pingouin.Oeil_D.rotation.x = 0.005*Math.sin(time*4);
			Pingouin.Bouche.scale.y =0.012+0.01* Math.sin(time*10);
			Pingouin.BrasD.rotation.z = 0.5*Math.cos(time*3);
			Pingouin.BrasG.rotation.z = 0.5*Math.sin(time*3);
			
			CQ.position.set(0,time%4,0);
			Antenne_Y.rot_Y.rotation.y=Math.sin(time*0.8);
			Antenne_Y.rot_Y.rotation.x=-0.2+0.15*Math.sin(time);
    }
    ciel_Screen.rotation.y=time/200;
    renderer.render(scene, camera);

    requestAnimationFrame(render);
  }
  requestAnimationFrame(render);
 
}

 
function onMouseMove( ev ) {

	camera.position.x = -5*(0.3-ev.clientX / window.innerWidth);
	camera.position.y = 2+2*(0.5-ev.clientY / window.innerHeight);
	const point = new THREE.Vector3( 0,4, 0 );
    camera.lookAt( point );
}

function onMouseWheel( ev ) {

				const amount = ev.deltaY;
				if ( amount === 0 ) return;
				const dir = amount / Math.abs( amount );
				var zoomspeed = dir / 10;

				// Slow down default zoom speed after user starts zooming, to give them more control
				var minzoomspeed = 0.001;

}
main_3D();